static uint8_t running = 1;

//刷新显示
void matrix_render(void)
{
    int x, y;

    for (x = 0; x < width; x++)
    {
        for (y = 0; y < height; y++)
        {
            ledstring.channel[0].leds[(y * width) + x] = matrix[y * width + x];
        }
    }
}


//清除颜色信息
void matrix_clear(void)
{
    int x, y;

    for (y = 0; y < (height ); y++)
    {
        for (x = 0; x < width; x++)
        {
            matrix[y * width + x] = 0;
        }
    }
}

void matrix_write()
{
	//     0  1  2  3  4  5  6  7
	//0    □  □  □  □  □  □  □  □ 
	//8	   □  □  □  □  □  □  □  □
	//16   □  □  □  □  □  □  □  □
	//24   □  □  □  □  □  □  □  □
	//32   □  □  □  □  □  □  □  □ 
	//40   □  □  □  □  □  □  □  □
	//48   □  □  □  □  □  □  □  □ 
	//56   □  □  □  □  □  □  □  □
	
	//每一帧赋值 其实这里应该用memcpy() 不知怎么用
	int i;
	for (i=0; i<64; i++){	
		matrix[i] = Frame_Badapple[NowFrame][i];
		
	}

}

static void ctrl_c_handler(int signum)
{
    running = 0;
}

static void setup_handlers(void)
{
    struct sigaction sa =
    {
        .sa_handler = ctrl_c_handler,
    };

    sigaction(SIGINT, &sa, NULL);
    sigaction(SIGTERM, &sa, NULL);
}

int main(int argc, char *argv[])
{	
	
    int ret = 0;
	//申请存储LED矩阵颜色信息的内存 结构体大小*LED数量
    matrix = malloc(sizeof(ws2811_led_t) * led_count);
	
	//获取程序退出动作
    setup_handlers();

    if (ws2811_init(&ledstring))
    {
        return -1;
    }

	
    while (running)
    {

		matrix_write();//显示
		matrix_render();//刷新
		NowFrame++;//帧计数
		
		//如果超出帧最大数量，退出
		if(NowFrame > ARRAY_SIZE(Frame_Badapple)){break;}
		
		//操作失败则退出
        if (ws2811_render(&ledstring))
        {
            ret = -1;
            break;
        }

        // 30帧/秒 0.8微调
        usleep(1000000 / 30.8);
		
		printf("%d\n",NowFrame);
		
    }

	//退出清除LED显示
	matrix_clear();
	matrix_render();
	ws2811_render(&ledstring);
    ws2811_fini(&ledstring);

    printf ("\n Goodbye :) \n");
    return ret;
}

